import React from 'react'

export default function Login() {

    return (
        <>
            <div>LOGIN PAGE</div>
            <div>Username</div>
            <input ref={usernameInput} type ="text"/>
            <div>Password</div>
            <input type ="password"/>
            <button>Login</button>
        </>
    )
}
